[Form]
public class WHSShipPlanningListPage extends FormRun implements SysIFilterConsumerForm
{
    WHSShipmentStatus               shipmentStatusFilter;
    QueryBuildRange                 qbrShipment;
    SalesTable                      salesTableArgs;
    InventTransferTable             transferArgs;
    WHSShipPlanningListPageForm     shipPlanningListPageForm;
    WHSShipmentDetailsForm          shipmentDetailsForm;
    boolean                         activeOnly;
    boolean                         showClosedShipments;
    boolean                         filteredByMenuItem;
    boolean                         isBrazilEnabled;

    private boolean                 showWaveLabelDetails;

    private boolean                 shipmentTableExecuteQueryWasRun;
    private boolean                 shipmentLatestWaveLabelDetailsViewLinkedTypePassiveFlight = WHSShipmentLatestWaveLabelDetailsViewLinkedTypePassiveFlight::instance().isEnabled();

    #define.CurrentVersion(1)
    #localmacro.CurrentList
        showWaveLabelDetails
