/// <summary>
/// This method will disable the filter that just shows shipments that do not have a related approved fiscal document.
/// </summary>
/// <remarks>
/// The filter will be removed by disabling the datasource that adds the predicate.
/// </remarks>
public void disableFilterShowShipMissingAprovFdoc_BR()
{
    QueryBuildDataSource loadLinesPendingApprovedFdocQbds;

    if (!whsShipmentTable_DS.query())
    {
        return;
    }

    loadLinesPendingApprovedFdocQbds = whsShipmentTable_DS.query().dataSourceTable(tableNum(WHSLoadLinePendingApprovedFdoc_BR));

    if (loadLinesPendingApprovedFdocQbds)
    {
        loadLinesPendingApprovedFdocQbds.enabled(false);
    }
}

    public void init()
    {
        if (element.args().parmEnumType() == enumNum(WHSShipmentStatus))
        {
            filteredByMenuItem = true;
            shipmentStatusFilter = element.args().parmEnum();
        }

        if (element.args().menuItemName() == menuitemDisplayStr(WHSShipPlanningListPageActive))
        {
            filteredByMenuItem = true;
            activeOnly = true;
        }

        switch (element.args().dataset())
        {
            case tableNum(SalesTable):
                salesTableArgs = element.args().record();
                break;

            case tableNum(InventTransferTable):
                transferArgs = element.args().record();
                break;
        }

        shipPlanningListPageForm    = new WHSShipPlanningListPageForm();
        shipmentDetailsForm         = new WHSShipmentDetailsForm();

        super();

		if (!shipmentLatestWaveLabelDetailsViewLinkedTypePassiveFlight)
		{
			WHSShipmentLatestWaveLabelDetails_ds.linkType(DataSourceLinkTypePropertyValues::Passive);
		}

		WHSShipmentLatestWaveLabelDetails_ds.object(fieldNum(WHSShipmentLatestWaveLabelDetails, WaveLabelsPrinted)).visible(false);
		WHSShipmentLatestWaveLabelDetails_ds.object(fieldNum(WHSShipmentLatestWaveLabelDetails, WaveLabelsPrintedBy)).visible(false);
		WHSShipmentLatestWaveLabelDetails_ds.object(fieldNum(WHSShipmentLatestWaveLabelDetails, WaveLabelsPrintedDateTime)).visible(false);

		xSysLastValue::getLast(this);

		ShowLabelDetails.visible(true);
		ShowLabelDetails.checked(showWaveLabelDetails);

		this.updateWaveLabelDetailsControlsVisible(showWaveLabelDetails);

        // <GBR>
        if (BrazilParameters::isEnabled())
        {
            isBrazilEnabled = true;
            ShowShipFdocNotApproved_BR.checked(false);
        }
        else
        {
            isBrazilEnabled = false;
        }
        // </GBR>

        if (element.args().record())
        {
            showClosed.value(true);
            showClosedShipments = true;

            whsShipmentTable_ds.executeQuery();
        }

        showClosed.enabled(!filteredByMenuItem);
        // <GBR>
        if (isBrazilEnabled == true)
        {
            ShowShipFdocNotApproved_BR.enabled(showClosed.checked());
        }
        // </GBR>

        if (!TmsUsmcaCertificateOfOriginFeature::isEnabled())
        {
            TMSUsmcaCertificateOfOrigin.visible(false);
        }
   }

/// <summary>
