public void initParmDefault()
{
}

public boolean unpack(container _packedClass)
{
    boolean ret;

    int version = conPeek(_packedClass, 1);

    switch (version)
    {
        case #CurrentVersion:
            [version, #CurrentList] = _packedClass;
            ret = true;
            break;
    }

    return ret;
}

/// <summary>
/// This method will add a filter to just show shipments that do not have a related approved fiscal document.
/// </summary>
public void showOnlyShipsMissingApprovFdoc_BR()
{
    QueryBuildDataSource loadLinesPendingApprovedFdocQbds;

    if (!whsShipmentTable_DS.query())
    {
        return;
    }

    loadLinesPendingApprovedFdocQbds = whsShipmentTable_DS.query().dataSourceTable(tableNum(WHSLoadLinePendingApprovedFdoc_BR));

    if (!loadLinesPendingApprovedFdocQbds)
    {
        loadLinesPendingApprovedFdocQbds = whsShipmentTable_DS.queryBuildDataSource().addDataSource(tableNum(WHSLoadLinePendingApprovedFdoc_BR));
        loadLinesPendingApprovedFdocQbds.joinMode(JoinMode::ExistsJoin);
        loadLinesPendingApprovedFdocQbds.relations(false);
        loadLinesPendingApprovedFdocQbds.addLink(fieldNum(WHSLoadLinePendingApprovedFdoc_BR, ShipmentId), fieldNum(WHSShipmentTable, ShipmentId));
    }

    whsLoadLine_DS.queryBuildDataSource().joinMode(JoinMode::InnerJoin);
    loadLinesPendingApprovedFdocQbds.enabled(true);
}

private void enableTMSActions(boolean _enable)
{
    TransportationActionTab.enabled(_enable);

    TMSPackingList.enabled(_enable);
    TMSCertificateOfOrigin.enabled(_enable);
    TMSCoCCertificateOfOrigin.enabled(_enable);
    TMSCommercialInvoice.enabled(_enable && whsShipmentTable.WorkTransType  == WHSWorkTransType::Sales);
    TMSUsmcaCertificateOfOrigin.enabled(_enable);
}

private void enableHMIM(boolean _enable)
{
    HMIMCarrOfMerchByRoad.enabled(_enable);
    HMIMMultimodalDG.enabled(_enable);
    HMIMShipperDeclaration.enabled(_enable);
    HMIMShipmentSummary.enabled(_enable);
    HMIMVerifiedGrossMass.enabled(_enable);
}

public int active()
{
    int ret;

    ret = super();

    this.enableTMSActions(whsShipmentTable.canUseTMSActions());
    this.enableHMIM(HMIMShipConfirm::isEnabledForShipment(whsShipmentTable));

    shipPlanningListPageForm.enableConsolidateShipments(btnConsolidateShipments, whsShipmentTable);

    shipPlanningListPageForm.enableTransferShipment(transfer, whsShipmentTable);
    shipPlanningListPageForm.enableTransferShipmentNew(transferNew, whsShipmentTable);

    whsShipmentLocationChange.enabled(whsShipmentTable.ShipmentStatus != WHSShipmentStatus::Shipped);
    skipWorkLine.enabled(whsShipmentTable.ShipmentStatus > WHSShipmentStatus::Open && whsShipmentTable.ShipmentStatus < WHSShipmentStatus::Shipped);
    printPickList.enabled(whsShipmentTable.ShipmentStatus >= WHSShipmentStatus::Waved);
    workButton.enabled(whsShipmentTable.canHaveWork());

    btnOutboundShipConfirm.enabled(WHSShipConfirm::isShipConfirmEnabledForShipment(whsShipmentTable));
    btnPostPackingSlip.enabled(WHSShipConfirm::isPackingSlipEnabledForShipment(whsShipmentTable));
    btnSendASN.enabled(WHSShipConfirm::isSendASNEnabledForShipment(whsShipmentTable));
    btnBillOfLading.enabled(WHSShipConfirm::isBOLEnabledForShipment(whsShipmentTable));
    WHSWaveLabel.enabled(WHSWaveLabel::existShipmentId(WHSShipmentTable.ShipmentId));

    return ret;
}

public void executeQuery()
{
    //Don't set qbrShipment for the first run of executeQuery to protect against overwriting initially loaded saved view range. Instead of that, set it in dataSource init
    if (shipmentTableExecuteQueryWasRun)
    {
        qbrShipment = SysQuery::findOrCreateRange(WHSShipmentTable_ds.queryBuildDataSource(), fieldNum(WHSShipmentTable, ShipmentStatus));
        qbrShipment.value(shipPlanningListPageForm.shipmentsFilteredByMenuItem(filteredByMenuItem, showClosedShipments, qbrShipment));
        qbrShipment.enabled(true);
    }

    super();
    shipmentTableExecuteQueryWasRun = true;
}

public void init()
{
    QueryBuildDataSource        shipmentTable;

    super();

    shipmentTable = whsShipmentTable_q.dataSourceTable(tableNum(WHSShipmentTable));
    qbrShipment = shipmentTable.addRange(fieldNum(WHSShipmentTable, ShipmentStatus));

    if (!filteredByMenuItem)
    {
        qbrShipment.value(shipPlanningListPageForm.shipmentsFilteredByMenuItem(filteredByMenuItem, showClosedShipments, qbrShipment));
    }
    else
    {
        if (element.args().parmEnumType() == enumNum(WHSShipmentStatus))
        {
            qbrShipment.value(queryValue(enum2int(shipmentStatusFilter)));
        }

        if (activeOnly)
        {
            qbrShipment.value(queryRange(enum2int(WHSShipmentStatus::Waved), enum2int(WHSShipmentStatus::Loaded)));
        }
    }

    this.addRangesToShipmentDataSource(shipmentTable);

    this.cacheAddMethod(tableMethodStr(WHSShipmentTable, displayTotalWeight));
    this.cacheAddMethod(tableMethodStr(WHSShipmentTable, displayCustName));
    this.cacheAddMethod(tableMethodStr(WHSShipmentTable, displayTotalVolume));
    this.cacheAddMethod(tableMethodStr(WHSShipmentTable, displayNumberOfContainers));
    this.cacheAddMethod(tableMethodStr(WHSShipmentTable, displayNumberOfLoadLines));
    this.cacheAddMethod(tableMethodStr(WHSShipmentTable, displayDropOffDate));
    this.cacheAddMethod(tableMethodStr(WHSShipmentTable, displayPickUpDate));
    this.cacheAddMethod(tableMethodStr(WHSShipmentTable, displayCarrierCode));
}

[Wrappable(true)]
internal void addRangesToShipmentDataSource(QueryBuildDataSource _shipmentTable)
{
    if (salesTableArgs)
    {
        _shipmentTable.addRange(fieldNum(WHSShipmentTable, OrderNum)).value(salesTableArgs.SalesId);
        _shipmentTable.addRange(fieldNum(WHSShipmentTable, WorkTransType)).value(queryValue(enum2int(WHSWorkTransType::Sales)));
    }

    if (transferArgs)
    {
        _shipmentTable.addRange(fieldNum(WHSShipmentTable, OrderNum)).value(transferArgs.TransferId);
        _shipmentTable.addRange(fieldNum(WHSShipmentTable, WorkTransType)).value(strFmt('((%1.%2 == %3) || (%1.%2 == %4))',
                                                                                          tableStr(WHSShipmentTable),
                                                                                          fieldStr(WHSShipmentTable, WorkTransType),
                                                                                          any2int(WHSWorkTransType::TransferIssue),
                                                                                          any2int(WHSWorkTransType::TransferReceipt)));
    }
}

public void init()
{
    QueryBuildDataSource    loadLine;

    super();

    loadLine = whsLoadLine_q.dataSourceTable(tableNum(WHSLoadLine));
    loadLine.addRange(fieldNum(WHSLoadLine, ShipmentId)).value(SysQuery::valueNotEmptyString());
}

public boolean modified()
{
    boolean ret;

    ret = super();

    showClosedShipments = showClosed.checked();

    // <GBR>
    if (isBrazilEnabled)
    {
        this.updateShowShipFdocNotApproved_BR();
    }
    // </GBR>

    whsShipmentTable_ds.executeQuery();

    return ret;
}

/// <summary>
/// Updates the show shipments missing approved fiscal document control
/// and the shipment table data source query accordingly to
/// changes on the show closed shipments control.
/// </summary>
/// <remarks>
/// This method is just executed when the company is in Brazil.
/// </remarks>
private void updateShowShipFdocNotApproved_BR()
{
    if (showClosedShipments == false)
    {
        if (ShowShipFdocNotApproved_BR.checked())
        {
            element.disableFilterShowShipMissingAprovFdoc_BR();
        }

        ShowShipFdocNotApproved_BR.checked(false);
        ShowShipFdocNotApproved_BR.enabled(false);
    }
    else
    {
        ShowShipFdocNotApproved_BR.enabled(true);
    }
}

public boolean modified()
{
    boolean ret;

    ret = super();

    showWaveLabelDetails = ShowLabelDetails.checked();

    element.updateWaveLabelDetailsControlsVisible(showWaveLabelDetails);

    return ret;
}

public boolean modified()
{
    boolean ret;

    ret = super();

    this.updateShipmentsFilterRelatedToApprovFdoc();

    whsShipmentTable_ds.executeQuery();

    return ret;
}
